const Discord = require('discord.js');
const client = new Discord.Client();
const prefix = '!';
const poll = (message, question) => {
    const filter = (reaction, user) => {
        return ['✅', '❌'].includes(reaction.emoji.name);
    };
    message.channel.send(`${question}`).then(sentMessage => {
        sentMessage.react('✅')
            .then(() => sentMessage.react('❌'));
        sentMessage.awaitReactions(filter, { max: 1, time: 60000, errors: ['time'] })
            .then(collected => {
                const reaction = collected.first();
                if (reaction.emoji.name === '✅') {
                    message.channel.send('The poll resulted in a yes vote.');
                } else {
                    message.channel.send('The poll resulted in a no vote.');
                }
            })
            .catch(collected => {
                message.channel.send('The poll has ended without a clear result.');
            });
    });
}
client.on('message', message => {
    if (message.content.startsWith(`${prefix}poll`)) {
        const args = message.content.slice(prefix.length).trim().split(' ');
        const command = args.shift().toLowerCase();
        if (args.length > 0) {
            poll(message, args.join(' '));
        } else {
            message.channel.send('Please provide a question for the poll.');
        }
    }
});
client.login('your-token-goes-here');
